                    details = { "2.5 Years Enterprise Experince"}

                    />
                </div>
                <div style={{top: '12rem', left:'-4rem'}}>
                    <Card
                        emoji = {Glasses}
                        heading = {'Education'}
                        details = { "Bachelor of Science in Software Engineering"}

                    />
                </div>
            </div>


        </div>
    )
}

export default About
